import React from 'react';
import { Menu, Button, MenuItem } from '@material-ui/core';

export default function SimpleMenu() {
    const [anchorEl, setAnchorEl] = React.useState(null);

    const handleClick = (event) => {
        setAnchorEl(event.currentTarget);
    };

    handleClose = () => {
        this.setState(document.getElementById("simple-menu").value = "12:00am");
        setAnchorEl(null);
    };

    return (
        <div>
            <Button aria-controls="simple-menu" aria-haspopup="true" onClick={handleClick}>
                Time
      </Button>
            <Menu
                id="simple-menu"
                anchorEl={anchorEl}
                keepMounted
                open={Boolean(anchorEl)}
                onClose={this.handleClose}
                PaperProps={{ style: {maxHeight: 200}} }
            >
                <MenuItem onClick={this.handleClose}>12:00am</MenuItem>
                <MenuItem onClick={this.handleClose}>12:15am</MenuItem>
                <MenuItem onClick={this.handleClose}>12:30am</MenuItem>
                <MenuItem onClick={this.handleClose}>12:45am</MenuItem>
                <MenuItem onClick={this.handleClose}>1:00am</MenuItem>
                <MenuItem onClick={this.handleClose}>1:15am</MenuItem>
                <MenuItem onClick={this.handleClose}>1:30am</MenuItem>
                <MenuItem onClick={this.handleClose}>1:45am</MenuItem>
                <MenuItem onClick={this.handleClose}>2:00am</MenuItem>
                <MenuItem onClick={this.handleClose}>2:15am</MenuItem>
                <MenuItem onClick={this.handleClose}>2:30am</MenuItem>
                <MenuItem onClick={this.handleClose}>2:45am</MenuItem>
                <MenuItem onClick={this.handleClose}>3:00am</MenuItem>
                <MenuItem onClick={this.handleClose}>3:15am</MenuItem>
                <MenuItem onClick={this.handleClose}>3:30am</MenuItem>
                <MenuItem onClick={this.handleClose}>3:45am</MenuItem>
                <MenuItem onClick={this.handleClose}>4:00am</MenuItem>
                <MenuItem onClick={this.handleClose}>4:15am</MenuItem>
                <MenuItem onClick={this.handleClose}>4:30am</MenuItem>
                <MenuItem onClick={this.handleClose}>4:45am</MenuItem>
                <MenuItem onClick={this.handleClose}>5:00am</MenuItem>
                <MenuItem onClick={this.handleClose}>5:15am</MenuItem>
                <MenuItem onClick={this.handleClose}>5:30am</MenuItem>
                <MenuItem onClick={this.handleClose}>5:45am</MenuItem>
                <MenuItem onClick={this.handleClose}>6:00am</MenuItem>
                <MenuItem onClick={this.handleClose}>6:15am</MenuItem>
                <MenuItem onClick={this.handleClose}>6:30am</MenuItem>
                <MenuItem onClick={this.handleClose}>6:45am</MenuItem>
                <MenuItem onClick={this.handleClose}>7:00am</MenuItem>
                <MenuItem onClick={this.handleClose}>7:15am</MenuItem>
                <MenuItem onClick={this.handleClose}>7:30am</MenuItem>
                <MenuItem onClick={this.handleClose}>7:45am</MenuItem>
                <MenuItem onClick={this.handleClose}>8:00am</MenuItem>
                <MenuItem onClick={this.handleClose}>8:15am</MenuItem>
                <MenuItem onClick={this.handleClose}>8:30am</MenuItem>
                <MenuItem onClick={this.handleClose}>8:45am</MenuItem>
                <MenuItem onClick={this.handleClose}>9:00am</MenuItem>
                <MenuItem onClick={this.handleClose}>9:15am</MenuItem>
                <MenuItem onClick={this.handleClose}>9:30am</MenuItem>
                
            </Menu>
        </div>
    );
}
